In JavaScript, you can use the `localeCompare()` method to perform case-sensitive sorting. Here's an example:

```javascript
const names = ["John", "john", "Alice", "alice"];

names.sort((a, b) => a.localeCompare(b));

console.log(names);
// Output: ["Alice", "alice", "John", "john"]
```

However, if you want to perform case-insensitive sorting, you can use the `toLowerCase()` or `toUpperCase()` method to convert both strings to lowercase or uppercase before comparing them:

```javascript
const names = ["John", "john", "Alice", "alice"];

names.sort((a, b) => a.toLowerCase().localeCompare(b.toLowerCase()));

console.log(names);
// Output: ["alice", "Alice", "john", "John"]
```

Alternatively, you can use the `Intl.Collator` API to perform case-insensitive sorting:

```javascript
const names = ["John", "john", "Alice", "alice"];

const collator = new Intl.Collator(undefined, { sensitivity: 'base' });
names.sort(collator.compare);

console.log(names);
// Output: ["alice", "Alice", "john", "John"]
```

Note that the `Intl.Collator` API is not supported in older browsers, so you may need to use a polyfill or a fallback solution if you need to support older browsers.

