```jsx
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { TooltipProvider } from './TooltipContext';

ReactDOM.render(
  <React.StrictMode>
    <TooltipProvider>
      <App />
    </TooltipProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
```

